import React, {useEffect, useState} from 'react';
import axios from "axios";

const Cast = ({id}) => {

    let url = `https://api.jikan.moe/v3/anime/${id}/characters_staff`;

    const [cast, setCast] = useState([]);


    useEffect(()=>{
        (async function()
        {
            try
            {
                const res = await axios.get(url);
                res.data.characters.map((character)=>(character.voice_actors.map((actor)=>actor.language.contains("japanese"))) ? setCast(character):(null));
                console.log(cast);
            }
            catch(err)
            {
                console.log(err);
            }
        })();
    }, [url]);

    return (
        <div className='cast'>
            
        </div>
    )
}

export default Cast;
